import React from 'react';
import './MyForm.css';

class MyForm extends React.Component{
  render() {
    return(
      <fieldset>
        <label>
          Nome:
          <input type="text" placeholder="Digite seu nome"/>
        </label>
        <label>
          Email:
          <input type="email" placeholder="Digite um email valido"/>
        </label>
        <label>
          CPF:
          <input type="number"/>
        </label>

      </fieldset>
    )
  }
}
export default MyForm;
